import React, { Component } from "react";
import { connect } from "inferno-redux";
import {
  addTodo,
  getTodo,
  editTodo,
  getTodos,
  deleteTodo
} from "../actions/todoActions";

const IndividualTodo = ({ otherProp }) => (
  <div>
    <h1>asd</h1>
  </div>
);

const mapStateToProps = state => ({
  todo: state.todo
});

export default connect(
  mapStateToProps,
  { addTodo, getTodo, editTodo, getTodos, deleteTodo }
)(IndividualTodo);
